import React from "react";
import { Button, Container } from 'react-bootstrap';
import logo from '../../assest/Logo.png'
import './header.css'

const Header = () => {
    return (
        <Container fluid>
            <div className="App">
                <img src={logo} style={{ width: '150px' }} />
                <hr></hr>
            </div>
        </Container>
    );
}

export default Header;
